ent_id': 429144556, 'comment_body': '`assertEquals("rocksMap.get() returned the wrong value", 1, rocksMap.get("Hello"));`. Note the order, first the expected then the actual value. ', 'comment_created': datetime.datetime(2020, 5, 22, 9, 34, 4, tzinfo=datetime.timezone.utc), 'commenter': 'mtopolnik', 'type': 'User'}, {'comment_id': 429146473, 'comment_body': "As the complexity of the test grows, you can see the advantage of adopting this structure:

